import math
import random

class ModTile():
    def __init__(self, label, oper, desc=0):
        self.label = label
        self.oper = oper
        if desc == 0:
            self.desc = f"Performs '{label}' to your number total when passed through."
        else:
            self.desc = f"{desc} when passed through."


class BlockTile():
    def __init__(self, target):
        self.target = target

def reverse(n, rev=0):
    if n < 10:
        return rev * 10 + n
    return reverse(n // 10, rev * 10 + n % 10)

def factorial(n):
    if n > 6:
        return n
    if n <= 1:
        return 1
    return n * factorial(n - 1)

def sumdig(n):
    if n < 10:
        return n
    return n % 10 + sumdig(n // 10)

